import React from 'react'

function Header() {
    return (
        <div className='header'>
            <div className='header__left'>
                {/* Avatar */}
                <Avatar />
                {/* TimeAccess Icon */}
            </div>
            <div className='header__center'>

            </div>
            <div className='header__right'>

            </div>
        </div>
    )
}

export default Header
